import React, { Component } from "react";

class UserPick extends Component {
  state = {
    users: ["weegembump", "happyamy2016", "jessjelly", "grumpy19"]
  };

  render() {
    return (
      <div>
        <h4>Please select a user to login as:</h4>
        {this.state.users.map((user, index) => (
          <h3 key={index}>{user}</h3>
        ))}
      </div>
    );
  }
}

export default UserPick;
